import { TextInput } from "evergreen-ui";

function Kanban() {
    const textinput = {
        height: "40px",
        width: "411px",
        border: "1px solid #E5E5E5",
        borderRadius: "2px",
        marginBottom: "29px",
    };
    const textinput1 = {
        height: "40px",
        width: "247px",
        border: "1px solid #E5E5E5",
        borderRadius: "2px",
        marginTop: "7px",
        marginBottom: "23px",
    };
    let history = useHistory();
    return (
        <div>
            <div
                className="back"
                onClick={() => {
                    history.goBack();
                }}
            >
                <img src={create_back} alt="" height="14" width="14.97" />
            </div>
            <div className="blank_project">
                <h2>New project</h2>
                <p className="name">Name</p>
                <TextInput style={textinput} />
                <p className="key">
                    Key<span>*</span>
                </p>
                <TextInput style={textinput1} />
