                <p className="des">Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
                <p className="des">Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
                <button className="btn">Create Project</button>
            </div>
        </div>
    );
}

export default Kanban;
